%pyspark



print """%html 
    <!DOCTYPE html>
    <meta charset="utf-8">
    <style>
      div.tooltip {	
        position: absolute;			
        text-align: center;
        padding: 2px;		
        font: 12px sans-serif;
        background: lightsteelblue;
        border: 0px;
        border-radius: 8px;
        pointer-events: none;			
    }
    </style>
    <body>
      <script src="https://d3js.org/d3.v3.min.js"></script>
      <div id="container"></div>
      <script>
        var div = d3.select("body").append("div")	
          .attr("class", "tooltip")				
          .style("opacity", 0);

  function handleClick(cb) {
	var zoom_id = (cb.id).replace('z','')
	console.log(zoom_id);
	if (document.getElementById("z" + zoom_id).checked) {
	  work(d3.selectAll("#graph" + zoom_id));
	}else{
	  d3.select("#graph" + zoom_id).on("dblclick.zoom", null).on("mousewheel.zoom", null)
	    .on("DOMMouseScroll.zoom", null)
	    .on("wheel.zoom", null);
  }
}

  function work(svg) {
  var w  = d3.transform(svg.attr("transform")).translate[0];
  var h  = d3.transform(svg.attr("transform")).translate[1];

	  svg.call(d3.behavior.zoom().scaleExtent([1, 8]).on("zoom", zoom));

	  svg.selectAll("text")
	  .on("mouseover", function(d) {
		var tmp = d3.select(this)[0][0].innerHTML;
			  div.transition()		
				  .duration(200)		
				  .style("opacity", .9);		
			  div.html("Node name: " + tmp + "<br/> Latitude: " + "122" + "<br/> Longitude: " + "90" )	
				  .style("left", (d3.event.pageX) + "px")
				  .style("top", (d3.event.pageY - 28) + "px");	
			  })					
		  .on("mouseout", function(d) {
			  div.transition()		
				  .duration(500)		
				  .style("opacity", 0);});

	  function zoom() {
		var s = d3.event.scale;
		var new_w = w + d3.event.translate[0];
		var new_h = h + d3.event.translate[1];
		svg.attr("transform", "translate(" + new_w + "," + new_h + ")scale(" + s + ")");
	  }
  }
  </script>
    </body>
        """

for i in range(5):
    with open("/home/workshop/g{0}.svg".format(i),"r") as f:
        svg_files_data = f.read()

    print """<label><input type='checkbox' id="z{0}" onclick='handleClick(this);'>Enable Zooming</label>""".format(str(i))
    print svg_files_data
